import React, { useEffect, useState } from "react";

function ReviewCard() {
  const [reviews, setReviews] = useState([]);
  useEffect(() => {
    const fetchReviews = async () => {
      const response = await fetch("api/reviews");
      const json = await response.json();

      if (response.ok) {
        setReviews(json);
      }
    };

    fetchReviews();
  }, []);
  return <div></div>;
}

export default ReviewCard;
